import { Link } from "react-router-dom";
import { useEffect, useState} from "react"

function Navbar(props) {
  var onlinestaus=0;

  let [searchkey,setSearchkey] = useState('');
  let getSearchVal=(e)=>{
    console.log('av searchkey',e.target.value);
    setSearchkey(e.target.value)

  }

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
  <Link to="/"> <a className="navbar-brand">My cakeshop</a></Link>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>

  <div className="collapse navbar-collapse" id="navbarSupportedContent">
    <ul className="navbar-nav mr-auto">
     <li>{props.children}   Hello {props.user}</li>

    </ul>
    <form className="form-inline my-2 my-lg-0">
      <input className="form-control mr-sm-2" onChange={getSearchVal} type="search" placeholder="Search" aria-label="Search"/>
      <Link to="/search/chocolate"> <button className="btn btn-outline-success my-2 my-sm-0" type="button">Search</button></Link>
    </form>
    <div>
       {
         props.loginstatus ? <button className="btn btn-danger">Logout</button>  
         : <Link to="/login"> <button className="btn btn-success">Login</button></Link>
        }
    </div>
  </div>
</nav>
  );
}

export default Navbar;
